import React from 'react';
// Import icons or images for each provider if needed.

const providers = [
  { name: 'TREMENDOUS', icon: 'path-to-tremendous-icon' },
  { name: 'Wallester', icon: 'path-to-wallester-icon' },
  // Add the rest of your providers here
];

const SelectProvider = () => {
  return (
    <div className="fixed inset-0 bg-black bg-opacity-50 flex justify-center items-center">
      <div className="p-4 bg-blue-900 text-white flex justify-between items-center">
        <button className="text-white">
          {/* Icon or text for back navigation */}
          <span>Back</span>
        </button>
        <h2 className="text-lg font-semibold">Select Your Provider</h2>
        <div></div> {/* Placeholder for spacing */}
      </div>
      <div className="flex-1 overflow-y-auto p-4 bg-gradient-to-br from-blue-800 to-blue-500">
        <div className="grid grid-cols-3 gap-4">
          {providers.map((provider, index) => (
            <div key={index} className="bg-blue-700 p-4 rounded-lg shadow-md">
              {/* Replace with an img tag or icon component as necessary */}
              <div className="flex justify-center items-center h-full">
                {provider.icon ? (
                  <img src={provider.icon} alt={provider.name} className="max-h-full" />
                ) : (
                  <span>{provider.name}</span>
                )}
              </div>
            </div>
          ))}
        </div>
      </div>
      <div className="p-4">
        {/* Add additional UI elements if necessary */}
      </div>
    </div>
  );
};

export default SelectProvider;
